import React, { Component } from "react";



class ToDoContainer extends Component {
  render() {
    return (
      <div>
        <div>
          <Add />
        </div>
        <div>
          <Current />
        </div>
        <div>
          <Search />
        </div>
      </div>
    );
  }
}

export default ToDoContainer;
